import React from "react";
import "./Sidebar.css";

const Sidebar = () => {
  return (
    <div>
      <h4>My Profile</h4>
      <img src="" />
      <div>
        <ul>
          <li>currently reading</li>
          <li>read later</li>
          <li>Book shelf readed</li>
        </ul>
      </div>
    </div>
  );
};

export default Sidebar;
